import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { GITHUB_URI } from "./apiLinks";
import axios from "axios";
import useFetchData from "../apiFetches/FetchData";
const User = () => {
  const { user } = useParams();
  //const data = useFetchData(`/users/${user}`);
  const [data, setData] = useState({});
  const [loading, setLoading] = useState(true);
  const path = useEffect(() => {
    const fetchData = async () => {
      try {
        const { data: response } = await axios.get(`${GITHUB_URI + path}`);
        setData(response);
      } catch (error) {
        console.error(error);
      }
      setLoading(false);
    };

    fetchData();
  }, [path]);
  return <div>{user}</div>;
};
export default User;
